import "./App.css";
import Dictionary from "./Dictionary.js";

function App() {
  return (
    <div className="App">
      <div className="container">
        <main>
          <h1>Welcome to Dictionary App</h1>
          <Dictionary />
        </main>
        <footer>Coded by Olivia Swann</footer>
      </div>
    </div>
  );
}

export default App;
